                f.writelines('\t\t<th>'+"Carrera"+'</th>\n')
                f.writelines('\t\t<th>'+"Carnet del mentor"+'</th>\n')
                f.writelines('\t</tr>\n')
                for j in diccionario:
                    if diccionario[j][3]== ultimaSede:
                        f.writelines('\t<tr>\n')
